import React from "react";
import './../css/home.css';
import {Header} from "./header";
import {Bar, BarChart, CartesianGrid, Legend, ResponsiveContainer, Tooltip, XAxis, YAxis} from "recharts";
const data = [
    {
        name: '2078',
        uv: 4000,
        pv: 2400,
        amt: 2400,
    },
    {
        name: 'Page B',
        uv: 3000,
        pv: 1398,
        amt: 2210,
    },
    {
        name: 'Page C',
        uv: 2000,
        pv: 9800,
        amt: 2290,
    },
    {
        name: 'Page D',
        uv: 2780,
        pv: 3908,
        amt: 2000,
    },
    {
        name: 'Page E',
        uv: 1890,
        pv: 4800,
        amt: 2181,
    },
    {
        name: 'Page F',
        uv: 2390,
        pv: 3800,
        amt: 2500,
    },
    {
        name: 'Page G',
        uv: 3490,
        pv: 4300,
        amt: 2100,
    },
];
export class Home extends React.Component{
    constructor() {
        super();
        this.state = {

        }
        this.updateText=this.updateText.bind(this);
        this.sendData=this.sendData.bind(this);
    }
    updateText(event){

    }
    sendData(){

    }
    componentDidMount(){

    }
    render() {
        return (
            <div id='home'>
                <Header/>
                <div id="container">
                    <div id="foo">
                        <div>डाटाहरु सर्भरमा अपलोड गर्नुहोस </div>
                        <div>डाटाहरु सर्भरबाट डाउनलोड गर्नुहोस </div>
                        <div>डाटाहरु कम्प्युटरमा ब्याककप गर्नुहोस </div>
                    </div>
                    <div id="conclusion-ward">
                        <div className="item">
                            <b>1 नं. वडा, टुकुचे</b>
                            <span>योजनाहरु : 50 वटा</span>
                            <span>लागत अनुमान : रु 355500 ।-</span>
                            <span>जनस्तरबाट : रु 355500 ।-</span>
                        </div>
                        <div className="item">
                            <b>2 नं. वडा, कोबाङ</b>
                            <span>योजनाहरु : 50 वटा</span>
                            <span>लागत अनुमान : रु 355500 ।-</span>
                            <span>जनस्तरबाट : रु 355500 ।-</span>
                        </div>
                        <div className="item">
                            <b>3 नं. वडा, लेते</b>
                            <span>योजनाहरु : 50 वटा</span>
                            <span>लागत अनुमान : रु 355500 ।-</span>
                            <span>जनस्तरबाट : रु 355500 ।-</span>
                        </div>
                        <div className="item">
                            <b>4 नं. वडा, घाँसा</b>
                            <span>योजनाहरु : 50 वटा</span>
                            <span>लागत अनुमान : रु 355500 ।-</span>
                            <span>जनस्तरबाट : रु 355500 ।-</span>
                        </div>
                        <div className="item">
                            <b>5 नं. वडा, कुञ्जो</b>
                            <span>योजनाहरु : 50 वटा</span>
                            <span>लागत अनुमान : रु 355500 ।-</span>
                            <span>जनस्तरबाट : रु 355500 ।-</span>
                        </div>
                    </div>
                    <div id="report">
                        <ResponsiveContainer width="100%" height="100%">
                            <BarChart
                                width={500}
                                height={300}
                                data={data}
                                margin={{
                                    top: 5,
                                    right: 30,
                                    left: 20,
                                    bottom: 5,
                                }}
                            >
                                <CartesianGrid strokeDasharray="3 3" />
                                <XAxis dataKey="name" />
                                <YAxis />
                                <Tooltip />
                                <Legend />
                                <Bar dataKey="pv" fill="darkgray" />
                                <Bar dataKey="uv" fill="" />
                            </BarChart>
                        </ResponsiveContainer>
                    </div>
                </div>
            </div>
        );
    }
}
